import React, { useState } from 'react';

function Curriculo() {
  const [nome, setNome] = useState('');
  const [email, setEmail] = useState('');
  const [telefone, setTelefone] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(`Nome: ${nome}\nE-mail: ${email}\nTelefone: ${telefone}`);
  };

  return (
    <div id="form" style={{ margin: '20px' }}>
      <h2>Formul√°rio de Cadastro</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Nome Completo:</label>
          <input
            type="text"
            value={nome}
            onChange={(e) => setNome(e.target.value)}
            required
            style={{ padding: '8px', width: '200px', marginBottom: '10px' }}
          />
        </div>

        <div>
          <label>E-mail:</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            style={{ padding: '8px', width: '200px', marginBottom: '10px' }}
          />
        </div>

        <div>
          <label>Telefone:</label>
          <input
            type="tel"
            value={telefone}
            onChange={(e) => setTelefone(e.target.value)}
            required
            style={{ padding: '8px', width: '200px', marginBottom: '10px' }}
          />
        </div>

        <button type="submit" style={{ padding: '10px 20px', backgroundColor: '#4CAF50', color: 'white' }}>Enviar</button>
      </form>
    </div>
  );
}

export default Curriculo;
